uint32_t alibc_rand (uint32_t *ctx)
{
    uint32_t x = *ctx ? *ctx : 42 << 16;
    x ^= x << 13;
    x ^= x >> 17;
    x ^= x << 5;
    *ctx = x;
    return (x + (x >> 16)) & 0x7fff;
}

