void test_few_alloca (void)
{
    unsigned char *p[10];
    int i, n;

    /* Allocate and fill each block with sizes: 1 .. elemof(p)	*/
    for (n = 1; n < (int)elemof(p); n++) {
	p[n-1] = alloca (n);
	memset (p[n-1], n, n);
    }

    /* Check that there is no overlapping.	*/
    for (n = 1; n < (int)elemof(p); n++) {
	for (i = 0; i < n; i++)
	    if (p[n-1][i] != n)
		exit (__LINE__);
    }
}

