void test_with_var_array (int n)
{
    unsigned char s[n];
    unsigned char *p;
    int i;

    /* Fill variable size array.	*/
    memset (s, 1, n);

    /* Allocate and fill the second array.	*/
    p = alloca (n);
    memset (p, 2, n);

    /* Refill the first array.	*/
    for (i = 0; i < n; i++) s[i] += 1;

    /* Check both.	*/
    if (memcmp (s, p, n))
	exit (__LINE__);
}

