	    CHECK (017uL << i, radix);
	    CHECK (~017uL << i, radix);
	}

	for (i = 0; i < 28; i++) {
	    CHECK (037uL << i, radix);
	    CHECK (~037uL << i, radix);
	}

	for (i = 0; i < 27; i++) {
	    CHECK (077uL << i, radix);
	    CHECK (~077uL << i, radix);
	}

	for (i = 0; i < 26; i++) {
	    CHECK (0177uL << i, radix);
	    CHECK (~0177uL << i, radix);
	}

	for (i = 0; i < 25; i++) {
	    CHECK (0377uL << i, radix);
	    CHECK (~0377uL << i, radix);
