int main ()
{
    char s[40];
    char *(* volatile fun)(unsigned, char *, int);
    volatile int rdx;

    /* Inline function, possible call of __ltoa_ncheck().	*/

    utoa (60000, s, 10);
    if (strcmp_P (s, PSTR ("60000")))
	EXIT (__LINE__);
    utoa (35, s, 2);
    if (strcmp_P (s, PSTR ("100011")))
	EXIT (__LINE__);
    utoa (35, s, 36);
    if (strcmp_P (s, PSTR ("z")))
	EXIT (__LINE__);

    if (utoa (2, s, 1) != s || s[0])
	EXIT (__LINE__);
    s[0] = '2';
    if (utoa (2, s, 37) != s || s[0])
	EXIT (__LINE__);
    s[0] = '2';
    if (utoa (2, s, 0x0108) != s || s[0])
	EXIT (__LINE__);

    /* Library function, call of utoa().	*/

    fun = utoa;
    fun (60000, s, 10);
    if (strcmp_P (s, PSTR ("60000")))
	EXIT (__LINE__);
    fun (35, s, 2);
    if (strcmp_P (s, PSTR ("100011")))
	EXIT (__LINE__);
    fun (35, s, 36);
    if (strcmp_P (s, PSTR ("z")))
	EXIT (__LINE__);

    if (fun (2, s, 1) != s || s[0])
	EXIT (__LINE__);
    s[0] = '2';
    if (fun (2, s, 37) != s || s[0])
	EXIT (__LINE__);
    s[0] = '2';
    if (fun (2, s, 0x0108) != s || s[0])
	EXIT (__LINE__);

    /* Unknown radix, call of __utoa().	*/

    rdx = 10;
    utoa (60000, s, rdx);
    if (strcmp_P (s, PSTR ("60000")))
	EXIT (__LINE__);
    rdx = 2;
    utoa (35, s, rdx);
    if (strcmp_P (s, PSTR ("100011")))
	EXIT (__LINE__);
    rdx = 36;
    utoa (35, s, rdx);
    if (strcmp_P (s, PSTR ("z")))
	EXIT (__LINE__);

    rdx = 1;
    if (utoa (2, s, rdx) != s || s[0])
	EXIT (__LINE__);
    rdx = 37;
    s[0] = '2';
    if (utoa (2, s, rdx) != s || s[0])
	EXIT (__LINE__);
    rdx = 0x0108;
    s[0] = '2';
    if (utoa (2, s, rdx) != s || s[0])
	EXIT (__LINE__);

    return 0;
}

