#include <avr/io.h>
#include <stdint.h>

int main ()
{
    /* One or both strings are empty.	*/
    CHECK ("", "", 0);
    CHECK ("", "\001", -1);
    CHECK ("", "\377", -255);
    CHECK ("\001", "", 1);
    CHECK ("\377", "", 255);

    /* Agrs are equal.	*/
    CHECK ("\001", "\001", 0);
    CHECK ("1234\377", "1234\377", 0);
    CHECK ("ABC", "ABC", 0);
    CHECK ("foo", "foo", 0);

    /* Args are not equal.	*/
    CHECK ("ABCDEF", "ABCDE", 'F');
    CHECK ("abcde", "abcdef", -'f');
    CHECK ("12345", "12245", 1);

    /* Case is important.	*/
    CHECK ("xyz", "xYz", 'y'-'Y');
    CHECK ("QUICK", "qUICK", 'Q'-'q');

    /* Chars are unsigned	*/
    CHECK ("\200", "\177", 1);
    CHECK ("\177", "\200", -1);
    CHECK ("\001", "\377", -254);
    CHECK ("\377", "\001", 254);

    return 0;
}

