#include <stdint.h>

int main ()
{
    /* Empty string.	*/
    CHECK ("", "", -1);
    CHECK ("A", "", -1);
    CHECK ("", "A", -1);

    /* accept[] length is 1.	*/
    CHECK ("A", "A", 0);
    CHECK (".B.", "B", 1);
    CHECK ("........C", "C", 8);
    CHECK ("a", "A", -1);
    CHECK ("AA", "a", -1);

    /* accept[] length is 2.	*/
    CHECK ("a.", "ab", 0);
    CHECK (".a", "ab", 1);
    CHECK ("b.", "ab", 0);
    CHECK (".b", "ab", 1);
    CHECK ("c", "ab", -1);
    CHECK ("0123456789", "56", 5);
    CHECK ("0123456789", "-+", -1);

    /* Long strings.	*/
    CHECK ("qwertyuiopasdfghjklzxcvbnm", "MNBVCXZLKJHGFDSAPOIUYTREWQ", -1);
    CHECK ("qwertyuiopasdfghjklzxcvbnm", "MNBVCXZLKJHGFDSAPOIUYTREWQm", 25);

    /* non ASCII chars	*/
    CHECK ("\001", "\001", 0);
    CHECK ("\377", "\377", 0);
    CHECK ("\002\376", "\001\377", -1);

    return 0;
}

